let target = "";
let localhost = "";
let availableRam = 0;
let hackRam = 0;
let growRam = 0;
let weakenRam = 0;
let maxMoney = 0;
let currMoney = 0;
let ramUsage = [];

const validOperations = ["hack", "weaken", "grow", "farm"];
let operationID = 0;
let killall = false;
const hackTools = ['hacker.js', 'grower.js', 'weakener.js', 'hack.js', 'grow.js', 'weaken.js'];

const Usage = "Usage: run hackBot.js [operation] [target] [OPTIONAL killall = false]";
//Runs optimal hacking, weakening, growing, or farming scripts on the current machine against the target host

/** @param {NS} ns */
export async function main(ns) {
  //Recieve arguments
  let operation = "";
  operation = ns.args[0] || "";
  target = ns.args[1] || "";
  killall = ns.args[2] || false;

  //Test arguments
  if (target === "") { ns.tprint(`ERROR ${Usage}`); return; }
  if (!ns.serverExists(target)) { ns.tprint(`ERROR Invalid hostname \"${target}\"`); return; }

  //Determine the operation selected
  switch (operation.toLowerCase()) {
    case validOperations[0]:
      operationID = 0; //hack
      break;
    case validOperations[1]:
      operationID = 1; //weaken
      break;
    case validOperations[2]:
      operationID = 2; //grow
      break;
    case validOperations[3]:
      operationID = 3; //farm
      break;
    default:
      ns.tprint(`ERROR Invalid operation \"${operation}\"\nValid operations are: ${validOperations.join(', ')}`);
      return;
  }
  //Tell the user what operation the program decided to do
  ns.tprint(`INFO Performing ${validOperations[operationID]} on \'${target}\'...`);

  localhost = ns.getHostname();

  //Get the latest versions of hack tools from home
  ns.scp(hackTools, localhost, 'home');

  //Get ram usage for each base operation
  hackRam = ns.getScriptRam('hack.js');
  weakenRam = ns.getScriptRam('weaken.js');
  growRam = ns.getScriptRam('grow.js');
  ramUsage = [hackRam, weakenRam, growRam];

  //If requested, kill all scripts except for this one
  if (killall) { ns.killall(localhost, 1); }

  //Get available ram
  availableRam = ns.getServerMaxRam(localhost) - ns.getServerUsedRam(localhost);

  //Run the code associated with the operation
  switch (operationID) {
    case 3:
      await farm(ns);
      break;
    default:
      await manualRun(ns);
  }

}

/** @param {NS} ns */
async function farm(ns) {
  //FARMING MODE
  //Ensure the target server is at minimum security
  // Weaken until at minimum

  //Get the minimum and current security level
  let minSec = ns.getServerMinSecurityLevel(target);
  let currSec = ns.getServerSecurityLevel(target);

  //If we are not at minimum security...
  if (currSec !== minSec) {
    //Calculate the total amount of times weaken needs to be run to reach minimum security
    let totalWeakenThreads = Math.ceil((currSec - minSec) / ns.weakenAnalyze(target));
    //Get the number of times weaken can be run at the same time
    let maxWeakThreads = Math.floor(availableRam / weakenRam);
    //If we can't even run one instance, error out
    if (maxWeakThreads === 0) { ns.tprint(`ERROR Not enough memory for weaken.js to be run!`); return; }

    let weakenTime = ns.getWeakenTime(target);

    //If the total number of times required is more than can be run at once, repeat until the total will be reached/exceeded
    if (totalWeakenThreads > maxWeakThreads) {
      let repeats = Math.ceil(totalWeakenThreads / maxWeakThreads);
      weakenTime *= repeats;
      ns.run('weaken.js', maxWeakThreads, [target, repeats]);
    }
    //Otherwise, run with the total required threads
    else {
      ns.run('weaken.js', totalWeakenThreads, [target]);
    }

    //Wait for the weakens to be completed - this is roughly accurate, but the weakens could end earlier than expected
    //given that the hacking level will increase and security will decrease B/W weakens when repeating
    await delay(weakenTime);
  }

  //Ensure the target server is already at 100% money
  //  Calculate the ratio of grows to weakens
  //  Run until 100% money

  //Get the maximum and current amount of money
  maxMoney = ns.getServerMaxMoney(target);
  currMoney = ns.getServerMoneyAvailable(target);

  if (currMoney !== maxMoney) {
    //Calculate the total amount of times grow needs to be run to max out the money
    let totalGrowThreads = Math.ceil(ns.growthAnalyze(target, maxMoney / currMoney));

  }

  //Hack the target server for a given percentage of money
  //Weaken the server to compensate for the hacking
}

/** @param {NS} ns */
async function manualRun(ns) {
  let threads = 0;
  let maxThreads = availableRam / ramUsage[operationID];
  ns.tprint(`The maximum amount of threads available is ${maxThreads}.`);
  //Request an amount of threads until the input is valid
  let input;
  while (true) {
    input = await ns.prompt("How many threads do you want to use?", { type: "text" });
    ns.tprint("INFO got past prompt");
    if (!isNaN(input) && input <= maxThreads && input > 0) { threads = input; break; }
    ns.tprint("ERROR Invalid amount of threads!");
  }

  let script = validOperations[operationID];
  let args = [];
  args.push(target);
  let runContinuous = await ns.prompt("Run continously? If yes, this could cause significant damage over time.");
  if (runContinuous) {script += "er"}
  else {
    while (true) {
      input = await ns.prompt("Number of repeats?", { type: "text" });
      if (!isNaN(input) && input > 0) { args.push(parseInt(input)); break; }
      ns.tprint("ERROR Invalid number of repeats!");
    }
  }

  script += ".js"
  ns.run(script,threads,args);
}

function delay(ms) {
  return new Promise(resolve => setTimeout(resolve, ms));
}

