#!/usr/bin/env bash

function check_root() {
    if [ "$EUID" -ne 0 ]; then
        echo "Este script deve ser executado como superusurio (root)."
        exit 1
    fi
}

function install_samba() {
    apt-get update; apt-get install samba -y
}

function backup_smb_conf() {
    cp /etc/samba/smb.conf /etc/samba/smb.conf.bak
}

# Configura o smb.conf com valores personalizados
function configure_smb_conf() {
    local share_name="Compartilhamento"
    local share_comment="Compartilhamento de Arquivos"
    local share_path="/caminho/do/diretorio/compartilhado"
    local user_name="seu_usuario"

    cat <<EOL > /etc/samba/smb.conf
[$share_name]
   comment = $share_comment
   path = $share_path
   valid users = $user_name
   read only = no
   browsable = yes
EOL
}

function set_samba_password() {
    clear
    echo -e "\nDefina uma senha para o usurio que ter acesso ao compartilhamento:"
    smbpasswd -a seu_usuario
}

function restart_samba() {
    service smbd restart
}

function check_samba_status() {
    if service smbd status | grep -q "Active: active (running)"; then
        echo "O servio Samba est online e em execuo."
    else
        echo "O servio Samba no est em execuo ou no est instalado corretamente."
        exit 1
    fi
}

function main() {
    check_root
    install_samba
    backup_smb_conf
    configure_smb_conf
    set_samba_password
    restart_samba
    check_samba_status
    echo "Configurao do Samba concluda. Voc pode acessar o compartilhamento em smb://seu_servidor/Compartilhamento (substitua 'seu_servidor' pelo nome do seu servidor na rede)."
}

